import React, { useState } from "react";
import { Button, Container, Toast, Table, Card, Form, FormControl, Row, Col } from "react-bootstrap";
import AjoutOption from "./AjoutOption"; // Assurez-vous que ce composant est correctement implémenté pour gérer l'ajout d'options.

const Options = () => {
  const [options, setOptions] = useState([
    {
      id: 1,
      name: "Climatisé",
      categories: ["Maison", "Appartement", "Studio"],
    },
    {
      id: 2,
      name: "chauffé",
      categories: ["Maison", "Bureau"],
    },
    {
      id: 3,
      name: "vue sur mer",
      categories: ["Maison", "Villa"],
    },
  ]);

  const [showForm, setShowForm] = useState(false);
  const [showToast, setShowToast] = useState(false);
  const [selectedOptionId, setSelectedOptionId] = useState(null);

  const handleDeleteClick = (optionId) => {
    setSelectedOptionId(optionId);
    setShowToast(true);
  };

  const confirmDeletion = () => {
    setOptions((currentOptions) =>
      currentOptions.filter((option) => option.id !== selectedOptionId)
    );
    setShowToast(false);
    setSelectedOptionId(null);
  };

  const addOption = (optionName, categories) => {
    const newId =
      options.length > 0
        ? Math.max(...options.map((option) => option.id)) + 1
        : 1;
    const newOption = {
      id: newId,
      name: optionName,
      categories: categories || [], // Assume categories are optionally passed
    };
    setOptions((prevOptions) => [...prevOptions, newOption]);
    setShowForm(false);
  };

  return (
    <Container>
      <div className="py-4">
        <Button className="btn-primary-custom mb-3" onClick={() => setShowForm(true)}>
          Ajouter Option
        </Button>
        {showForm && (
          <AjoutOption
            onAddOption={addOption}
            onClose={() => setShowForm(false)}
          />
        )}
        <Table bordered hover className="center">
          <thead>
            <tr>
              <th>Id</th>
              <th>Nom de l'option</th>
              <th>Catégories Associées</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {options.map((option) => (
              <tr key={option.id}>
                <td>{option.id}</td>
                <td>{option.name}</td>
                <td>{option.categories.join(", ")}</td>
                <td>
                  <Button variant="primary" className="mx-2">
                    Voir
                  </Button>
                  <Button variant="outline-primary" className="mx-2">
                    Éditer
                  </Button>
                  <Button
                    variant="danger"
                    className="mx-2"
                    onClick={() => handleDeleteClick(option.id)}
                  >
                    Supprimer
                  </Button>
                </td>
              </tr>
            ))}
          </tbody>
        </Table>
        {showToast && (
          <Toast
            onClose={() => setShowToast(false)}
            show={showToast}
            className="custom-toast-style"
            bg="light"
          >
            <Toast.Body>
              Êtes-vous sûr de vouloir supprimer cette option ?
              <div className="mt-2 d-flex justify-content-between">
                <Button variant="danger" size="sm" onClick={confirmDeletion}>
                  Confirmer
                </Button>
                <Button
                  variant="secondary"
                  size="sm"
                  onClick={() => setShowToast(false)}
                >
                  Annuler
                </Button>
              </div>
            </Toast.Body>
          </Toast>
        )}
      </div>
    </Container>
  );
};

export default Options;
